  `user_id` bigint(20) DEFAULT NULL COMMENT 'otc用户ID（otc_user表ID）',
  `account_type` int(11) DEFAULT NULL COMMENT '账户类型：1，币币交易可用余额账户；2，币币交易冻结账户；3，押金账户; ',
  `amount` decimal(30,10) DEFAULT NULL COMMENT '币数量',
  `coin_code` varchar(50) DEFAULT NULL COMMENT '币种code',
