DROP TABLE IF EXISTS `account_entry`;
CREATE TABLE `account_entry` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL COMMENT 'otc用户ID（otc_user表ID）',
  `otc_account_id` bigint(20) NOT NULL COMMENT '账户ID',
  `biz_type` int(11) DEFAULT NULL COMMENT '业务类型:1,资金划转订单: 2, 委托交易订单: 3, 撤销委托交易订单:',
  `amount` decimal(30,10) DEFAULT NULL COMMENT '本次操作币数量',
  `coin_code` varchar(50) DEFAULT NULL COMMENT '币种code',
  `account_type` int(11) DEFAULT NULL COMMENT '账户类型：1，可用账户；2，冻结账户；3，押金账户',
  `biz_order_no` varchar(50) NOT NULL COMMENT '业务订单号：包含划转、广告、订单等单号',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `gmt_created_time` datetime DEFAULT NULL,
  `gmt_modified_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account` (`otc_account_id`,`account_type`,`biz_type`,`biz_order_no`) USING BTREE
