DROP TABLE IF EXISTS `coin`;
CREATE TABLE `coin` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '英文简称',
  `type` tinyint(2) NOT NULL COMMENT '币种类型(1:人民币, 2:兑换币, 3:比特币, 4:比特币代币, 5:以太坊, 6:以太坊代币)',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '中文名称',
  `img` varchar(100) NOT NULL DEFAULT '' COMMENT '图标',
  `sort` int(11) unsigned NOT NULL DEFAULT '0',
  `fee_bili` varchar(50) NOT NULL DEFAULT '' COMMENT '挂单比例,%只能挂单当前账户的多少',
  `create_time` datetime DEFAULT NULL COMMENT '',
  `update_time` datetime DEFAULT NULL,
  `status` int(4) unsigned DEFAULT '0' COMMENT '状态，1：可用，0：禁止',
  `wallet_server_ip` varchar(200) DEFAULT '' COMMENT '钱包服务器ip ',
  `wallet_server_port` varchar(200) DEFAULT '' COMMENT '钱包服务器端口',
  `wallet_server_user` varchar(200) DEFAULT '' COMMENT '钱包服务器用户',
  `wallet_server_pwd` varchar(200) DEFAULT '' COMMENT '钱包服务器密码',
  `wallet_main_address` varchar(255) DEFAULT NULL COMMENT '钱包主账号地址(USDT、以太坊、以太坊代币必填)',
  `wallet_main_password` varchar(255) DEFAULT NULL COMMENT '钱包主账号密码或加密密码(以太坊、以太坊代币必填，如果比特币、泰达币等钱包进行了加密也必填)',
  `roll_in_give` decimal(20,8) DEFAULT '0.00000000' COMMENT '转入赠送(单位：%)',
  `roll_in_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '转入状态，1：正常转入，2：禁止转入',
  `roll_in_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '确认次数,转入确认次数必须填写,且大于0',
  `roll_in_sm` varchar(50) DEFAULT '',
  `roll_in_min` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最小转入数量',
  `roll_in_max` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最大转入数量',
  `roll_out_sm` varchar(50) DEFAULT '',
  `roll_out_fee` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '转出手续费 ,单位%',
  `roll_out_user` varchar(50) DEFAULT '',
  `roll_out_min` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最小转出数量',
  `roll_out_max` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最大转出数量',
  `roll_out_jz` varchar(50) DEFAULT '',
  `roll_out_zd_num` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '每天允许自动转出累计数量(为0则不限制,如果超过这个值, 则会转入后台进行审核)',
  `roll_out_day_num` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '每天允许自动转出累计数量(为0则不限制)',
  `roll_out_num` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '转出确认次数',
  `roll_out_zd` varchar(50) DEFAULT '' COMMENT '转出自动',
  `roll_out_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '转出状态，1：正常转出，2：禁止转出',
  `js_en` varchar(50) DEFAULT '' COMMENT '英文简称',
  `js_content` text COMMENT '详细介绍',
  `js_wallet_download` varchar(50) DEFAULT '' COMMENT '钱包下载',
  `js_code_download` varchar(50) DEFAULT '' COMMENT '源码下载',
  `js_link` varchar(50) DEFAULT '' COMMENT '官方链接',
  `js_lt` varchar(50) DEFAULT '',
  `js_mining` varchar(50) DEFAULT '' COMMENT '官方挖矿',
  `cs_develop` varchar(50) DEFAULT '' COMMENT '研发者',
  `cs_algorithm` varchar(50) DEFAULT '' COMMENT '核心算法',
  `cs_release_time` varchar(50) DEFAULT '' COMMENT '发布日期',
  `cs_block_speed` varchar(50) DEFAULT '' COMMENT '区块速度',
  `cs_count` varchar(50) DEFAULT '' COMMENT '发行总量',
  `cs_stock` varchar(50) DEFAULT '' COMMENT '存量',
  `cs_prove` varchar(50) DEFAULT '' COMMENT '证明方式',
  `cs_difficulty` varchar(50) DEFAULT '' COMMENT '难度调整',
  `cs_reward` varchar(50) DEFAULT '' COMMENT '区块奖励',
  `cs_character` varchar(50) DEFAULT '' COMMENT '主要特色',
  `cs_short` varchar(50) DEFAULT '' COMMENT '不足之处',
  `tp_zs` varchar(50) DEFAULT '',
  `tp_js` varchar(50) DEFAULT '',
  `tp_yy` varchar(50) DEFAULT '',
  `tp_qj` varchar(50) DEFAULT '',
  `block_number` int(50) NOT NULL DEFAULT '1' COMMENT '监听节点数',
  `is_del` int(1) DEFAULT '0' COMMENT '0、未删除1、已删除',
  `real_time_price` decimal(30,10) NOT NULL COMMENT '实时价格',
  `token` varchar(255) DEFAULT NULL COMMENT '代币token(以太坊代币类型不能为空)',
  `token_decimal` int(5) unsigned DEFAULT '18' COMMENT '代币小数位(以太坊代币类型不能为空, 默认18)',
  `balance_upper_limit_alarm` int(11) unsigned DEFAULT NULL COMMENT '平台余额上限报警值',
  `balance_lower_limit_alarm` int(11) unsigned DEFAULT NULL COMMENT '平台余额下限报警值',
  `txid` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=111 DEFAULT CHARSET=utf8 COMMENT='币种配置表';

