DROP TABLE IF EXISTS `entrust_msg_err_log`;
CREATE TABLE `entrust_msg_err_log` (
  `entrust_id` bigint(20) NOT NULL COMMENT '委托单ID',
  `user_id` bigint(20) DEFAULT NULL,
  `available_balance_account_id` bigint(20) DEFAULT NULL COMMENT '可用余额账户ID',
  `freezing_balance_account_id` bigint(20) DEFAULT NULL COMMENT '可用账户ID',
  `amount` decimal(30,10) DEFAULT NULL,
  `result` int(2) DEFAULT '0' COMMENT '处理结果（0 不需要回滚预估值  1需要回滚预估值）',
  `status` int(2) DEFAULT '0' COMMENT '处理状态 0 未处理  1 已处理 ',
