-- ----------------------------
-- Table structure for entrust_order
-- ----------------------------
DROP TABLE IF EXISTS `entrust_order`;
CREATE TABLE `entrust_order` (
  `id` bigint(20) NOT NULL,
  `market_id` int(11) DEFAULT NULL COMMENT '市场（币对）id',
  `market_code` varchar(100) DEFAULT NULL COMMENT '市场（币对）编码，例如BTC_USDT',
  `entrust_volume` decimal(20,10) DEFAULT NULL COMMENT '委托（挂单）总数量',
  `entrust_price` decimal(20,10) DEFAULT NULL COMMENT '限价单委托（挂单）单价',
  `deal_volume` decimal(20,10) DEFAULT NULL COMMENT '已成交数量',
  `deal_avg_price` decimal(10,2) DEFAULT NULL COMMENT '已成交平均单价',
  `fee_rate` decimal(20,10) DEFAULT NULL COMMENT '手续费费率',
  `fee_rate_discount` decimal(20,10) DEFAULT NULL COMMENT '手续费费率折扣',
  `frozen_fee` decimal(20,10) DEFAULT NULL COMMENT '手续费冻结总金额',
  `total_deal_fee` decimal(20,10) DEFAULT NULL COMMENT '已收取手续费',
  `user_id` bigint(20) DEFAULT NULL,
  `order_type` int(2) DEFAULT NULL COMMENT '订单类型（1币币 2杠杆）',
  `trade_type` int(2) DEFAULT NULL COMMENT '交易类型1买2卖',
  `entrust_way` int(2) DEFAULT NULL COMMENT '委托类型（1限价 2市价）',
  `status` int(2) DEFAULT NULL COMMENT '状态（1 未成交 2 部分成交 3全部成交 4 撤销）',
  `entrust_time` datetime DEFAULT NULL COMMENT '委托（挂单）时间',
  `gmt_created_time` datetime DEFAULT NULL COMMENT '订单创建（入库）时间（格林威治标准时间）',
  `gmt_modified_time` datetime DEFAULT NULL COMMENT '订单更新（入库）时间（格林威治标准时间）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='委托单';

-- ----------------------------
-- Records of entrust_order
-- ----------------------------

-- ----------------------------
-- Table structure for market
-- ----------------------------
DROP TABLE IF EXISTS `market`;
CREATE TABLE `market` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `coin_id` int(11) DEFAULT NULL COMMENT '交易币种ID',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '币种',
  `point_coin_id` int(11) DEFAULT NULL COMMENT '计价币种ID',
  `round` varchar(255) NOT NULL DEFAULT '',
  `fee_buy` varchar(255) NOT NULL DEFAULT '' COMMENT '买入手续费',
  `fee_sell` varchar(255) NOT NULL DEFAULT '' COMMENT '卖出手续费',
  `buy_min` varchar(255) NOT NULL DEFAULT '0' COMMENT '买入最小交易价',
  `buy_max` varchar(255) NOT NULL DEFAULT '0' COMMENT '买入最小交易价',
  `sell_min` varchar(255) NOT NULL DEFAULT '0' COMMENT '卖出最小交易价',
  `sell_max` varchar(255) NOT NULL DEFAULT '0' COMMENT ' 卖出最大交易价',
  `trade_min` varchar(255) NOT NULL DEFAULT '0' COMMENT '单笔最小交易额',
  `trade_max` varchar(255) NOT NULL DEFAULT '0' COMMENT '单笔最大交易额',
  `invit_buy` varchar(50) DEFAULT '',
  `invit_sell` varchar(50) DEFAULT '',
  `zhang` varchar(255) NOT NULL DEFAULT '0' COMMENT '涨幅限制（单位：%）',
  `die` varchar(255) NOT NULL DEFAULT '0' COMMENT '跌幅限制（单位：%）',
  `hou_price` varchar(255) NOT NULL DEFAULT '0' COMMENT '前一天最后一笔交易金额',
  `float_price` int(11) unsigned NOT NULL DEFAULT '6' COMMENT '价格小数位限制',
  `float_number` int(11) NOT NULL DEFAULT '6' COMMENT '数量小数位限制',
  `tendency` varchar(1000) DEFAULT '',
  `zoushi` text COMMENT '走势',
  `trade` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否开启交易，0：禁止交易，1：开启交易',
  `new_price` decimal(20,8) unsigned DEFAULT '0.00000000',
  `buy_price` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '买价（最佳卖价）',
  `sell_price` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '卖价（最佳买价）',
  `min_price` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '最低价',
  `max_price` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '最高价',
  `volume` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '成交量',
  `day_change` decimal(20,8) DEFAULT '0.00000000' COMMENT '日涨跌',
  `api_min` decimal(20,8) unsigned DEFAULT '0.00000000',
  `api_max` decimal(20,8) unsigned DEFAULT '0.00000000',
  `sort` int(11) unsigned DEFAULT '0',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `open_time` varchar(10) DEFAULT NULL COMMENT '开启时间',
  `close_time` varchar(10) DEFAULT NULL COMMENT '关闭时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态，0：禁用，1：可用（币种是否显示）',
  `hot` tinyint(1) unsigned DEFAULT '0' COMMENT '热门状态 0：非热门，1:热门',
  `is_del` int(1) DEFAULT '0' COMMENT '是否删除0、不删除1、已删除',
  `maxbuy` int(11) DEFAULT NULL,
  `minsell` int(11) DEFAULT NULL,
  `region` int(11) DEFAULT NULL,
  `matcher_exchange_name` varchar(255) DEFAULT '' COMMENT '撮合交换机名称(一个撮合支持一或多个币对市场)，这个字段不能提供给运营配置',
  PRIMARY KEY (`id`),
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='行情配置表';

-- ----------------------------
-- Records of market
-- ----------------------------

-- ----------------------------
-- Table structure for trade_log
-- ----------------------------
DROP TABLE IF EXISTS `trade_log`;
CREATE TABLE `trade_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员id',
  `peer_id` int(11) unsigned DEFAULT '0',
  `user_trade_id` int(11) DEFAULT NULL COMMENT '成交委托ID',
  `peer_trade_id` int(11) DEFAULT NULL COMMENT '被成交委托ID',
  `market` varchar(50) DEFAULT '' COMMENT '币种名称，与market表的name一致',
  `market_id` int(11) DEFAULT NULL COMMENT '市场ID',
  `price` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '单价',
  `num` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '数量',
  `mum` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '总额',
  `fee_buy` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '买入手续费',
  `fee_sell` decimal(20,8) unsigned DEFAULT '0.00000000' COMMENT '卖出手续费',
  `type` tinyint(2) unsigned DEFAULT '0' COMMENT '类型，1：买入。2：卖出',
  `sort` int(11) unsigned DEFAULT '0',
  `status` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态 ：0禁用、1启用',
  `is_automatic` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否刷单(1:正常交易 2:机器人交易)',
  `market_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '市场类型(1:普通交易市场 2:C2C交易市场)',
  `automatic_id` int(10) unsigned DEFAULT NULL,
  `show_trade` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示：(1:显示 2:不显示)',
  `buy_order_no` varchar(64) DEFAULT NULL COMMENT '买流水号',
  `sell_order_no` varchar(64) DEFAULT NULL COMMENT '卖流水号',
  `gmt_created_time` datetime DEFAULT NULL COMMENT '创建时间',
  `gmt_updated_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `status` (`status`) USING BTREE,
  KEY `userid` (`user_id`) USING BTREE,
  KEY `peerid` (`peer_id`) USING BTREE,
  KEY `create_time` (`gmt_created_time`) USING BTREE,
  KEY `market_id_show_trade` (`market_id`,`show_trade`) USING BTREE,
  KEY `automatic_id` (`automatic_id`) USING BTREE,
  KEY `market_id_createTime` (`market_id`,`gmt_created_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='交易日志表';

-- ----------------------------
-- Records of trade_log
-- ----------------------------

