DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `username` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '帐号',
  `truename` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(255) DEFAULT NULL,
  `moble` varchar(50) DEFAULT NULL COMMENT '手机号',
  `password` varchar(64) NOT NULL COMMENT '登录密码',
  `paypassword` varchar(64) DEFAULT NULL COMMENT '支付密码',
  `checktype` int(255) NOT NULL DEFAULT '0' COMMENT '交易验证类型',
  `idcardtype` tinyint(3) DEFAULT '0' COMMENT '证件类型(1:身份证2:护照)',
  `conf` text COMMENT '用户配置',
  `idcard` varchar(20) DEFAULT NULL COMMENT '身份证',
  `logins` int(10) DEFAULT NULL COMMENT '登录次数',
  `addip` varchar(32) DEFAULT NULL COMMENT 'ip地址',
  `addr` varchar(200) DEFAULT NULL COMMENT '内网IP',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `alipay` varchar(64) DEFAULT NULL COMMENT '支付宝',
  `idcard_img1` varchar(100) DEFAULT NULL COMMENT '身份证正面',
  `idcard_img2` varchar(100) DEFAULT NULL COMMENT '身份证反面',
  `idcard_img3` varchar(100) DEFAULT NULL COMMENT '手持身份证',
  `cardrz` tinyint(3) DEFAULT '0' COMMENT '认证结果(0:未实名认证、1:已实名认证 2:正在审核 3:未实名认证(分步注册))',
  `head_url` varchar(100) DEFAULT NULL COMMENT '用户头像',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '用户类型(1:注册用户 2:机器人)',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态(1启用、2禁用)',
  `seller_ident` tinyint(1) unsigned DEFAULT '1' COMMENT '1',
  `flag` varchar(255) DEFAULT NULL COMMENT '分组A-Z',
  `google_secret` varchar(50) DEFAULT NULL COMMENT 'google验证器私钥',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `refuse_cause` varchar(255) DEFAULT NULL COMMENT '身份认证不通过原因',
  `auth_time` datetime DEFAULT NULL COMMENT '身份认证上传时间',
  `ident_type` int(3) DEFAULT '0' COMMENT '认证类型：0普通认证；1阿里认证',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`) USING BTREE,
  UNIQUE KEY `moble` (`moble`) USING BTREE,
  KEY `user` (`id`,`username`,`moble`,`email`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1472 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

