INSERT INTO `coin` VALUES ('96', 'ETH', '5', '以太坊', 'group1/M00/00/07/wKhY3Vs8y1eAWM51AAJ1_hoPBR4967.jpg', '0', '0', '2018-03-16 20:14:05', '2018-07-29 23:42:04', '1', '192.168.88.231', '8588', '0x2d16D617B53eaA38A63Df7A68ed215bA3D335aCf', '123456789', '0x2d16d617b53eaa38a63df7a68ed215ba3d335acf', '123456789', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00100000', '0', '0.00000000', '10000.00000000', '', '1.00000000', '0.00000000', '1', '', '1', 'Ethereum', '<p><span>以太坊（</span>Ethereum<span>）是下一代密码学账本，打算支持众多的高级功能，包括用户发行货币，智能协议，去中心化的交易和我们认为的第一个完全的去中心化自治组织</span>(DAOs)<span>或去中心化自治公司（</span>DACs<span>）应用。以太坊（</span>Ethereum<span>）并不是把每一单个类型的功能作为特性来特别支持，相反，以太坊（</span>Ethereum<span>）包括一个内置的图灵完备的脚本语言，允许通过被称为“合同”的机制来为自己想实现的特性写代码。一个合同就像一个自动的代理，每当接收到一笔交易，合同就会运行特定的一段代码，这段代码能修改合同内部的数据存储或者发送交易。高级的合同甚至能修改自身的代码。</span>  </p><p><span>通俗一点说，以太坊是开源平台数字货币和区块链平台，它为开发者提供在区块链上搭建和发布应用的平台。</span>Ethereum<span>可以用来编程、分散、担保和交易任何事物，投票、域名、金融交易所，众筹、公司管理、合同和大部分的协议、知识产权，还有得益于硬件集成的智能资产。</span></p><p>2017<span>年</span>2<span>月</span>28<span>日，一批代表着石油、天然气行业，金融行业和软件开发公司的全球性企业正式推出企业以太坊联盟（</span>EEA<span>），致力于将以太坊开发成企业级区块链。这些企业包括英国石油巨头</span>BP<span>、摩根大通、软件开发商微软、埃森哲、桑坦德银行、</span>BlockApps<span>、</span>BNY<span>梅隆、芝商所、</span>ConsenSys<span>、英特尔微软和</span>Nuco<span>等。</span></p><p><span>许多企业或组织开发基于以太坊区块链的项目，并发行代币</span>Token<span>。联合国世界粮食计划署成功使用以太坊区块链向</span>10000<span>难民提供救助。</span></p><p><!--StartFragment--><!--EndFragment--></p><p><span>以太坊（</span>Ethereum<span>）的数字代币是以太币</span>ETH<span>，开发者们需要支付</span>ETH<span>来支撑应用的运行。和其他数字货币一样，</span>ETH<span>可以在交易平台上进行买卖。</span></p>', 'https://www.ethereum.org/cli', 'https://github.com/ethereum/', 'https://www.ethereum.org/', 'Unkown', 'https://www.ethereum.org/', 'VitalikButerin', 'Ethash', '2015-03-20', '约15-17秒/块', '10000', '10000', 'Unkown', 'Unkown', 'Unkown', '含数字货币和智能合约等特色功能', 'Unkown', '', '', '', '', '6056808', '0', '3183.0175000000', null, '18', null, null, 'https://etherscan.io/tx/');
