INSERT INTO `coin` VALUES ('100', 'USDT', '10', '泰达币', '2018060815250102625699699077926.png', '0', '0', '2018-03-20 16:45:43', '2018-07-29 23:53:57', '1', '192.168.88.225', '8332', 'ffk666', '@ffk$^67812', '1NDz7Q6C9Q36nHt54WsZhEcck4Ex9S2UkB', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00200000', '', '0.00000000', '10001.00000000', '', '5.00000000', '0.00000000', '1', '', '1', 'Tether', '<p>USDT<span>是</span>Tether<span>公司推出的基于稳定价值货币美元（</span>USD<span>）的代币</span>Tether USD<span>（下称</span>USDT<span>），</span>1USDT = 1<span>美元，用户可以随时使用</span>USDT<span>与</span>USD<span>进行</span>1<span>：</span>1<span>兑换。</span>Tether<span>公司严格遵守</span>1<span>：</span>1<span>准备金保证，即每发行</span>1<span>个</span>USDT<span>代币，其银行账户都会有</span>1<span>美元的资金保障。用户可以在</span>Tether<span>平台进行资金查询，以保障透明度。用户可以通过</span>SWIFT<span>电汇美元至</span>Tether<span>公司提供的银行帐户，或通过交易所换取</span>USDT<span>；赎回美元时，反向操作即可用户也可在交易平台用比特币换取</span>USDT<span>。</span><br></p><p></p><p><!--StartFragment--><!--EndFragment--></p><p>USDT<span>是在比特币区块链上发布的基于</span>Omni Layer<span>协议的数字资产。</span>USDT<span>最大的特点是，它与同数量的美元是等值的，在交易平台上可以互相赎买</span>.USDT<span>可以看成与比特币类似的代币，人们能够通过钱包转移，贮存和消费。</span>USDT<span>作为美元在数字网络上的复制品的设计，使之成为波动剧烈的加密货币市场中良好的保值代币。</span></p><p><br></p>', '/', '/', 'https://tether.to/', '/', '/', 'Craig Sellar ', 'script', '2014-12-26', '600秒/块', '324951410', '324951410', '/', '/', '/', '稳定的保值代币  1USDT=1美元', '/', '', '', '', '', '1', '0', '0.0000000000', null, '18', null, null, 'https://etherscan.io/');
INSERT INTO `coin` VALUES ('101', 'BTC', '3', '比特币', '20180608152158027565667514030134.png', '0', '0', '2018-03-20 16:47:07', '2018-07-29 23:54:08', '1', '192.168.88.242', '24406', 'at_home', 'at_home98k', '', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00100000', '', '0.00000000', '10001.00000000', '', '0.10000000', '0.00000000', '1', '', '1', 'BTC', '<p><!--StartFragment-->比特币（bitcoin）的概念最初由中本聪在2009年提出，根据中本聪的思路设计发布的开源软件以及建构其上的p2p网络。比特币是一种p2p形式的数字货币。点对点的传输意味着一个去中心化的支付系统。<br>与大多数货币不同，比特币不依靠特定货币机构发行，它依据特定算法，通过大量的计算产生，比特币经济使用整个p2p网络中众多节点构成的分布式数据库来确认并记录所有的交易行为，并使用密码学的设计来确保货币流通各个环节安全性。p2p的去中心化特性与算法本身可以确保无法通过大量制造比特币来人为操控币值。基于密码学的设计可以使比特币只能被真实的拥有者转移或支付。这同样确保了货币所有权与流通交易的匿名性。比特币与其他虚拟货币最大的不同，是其总数量非常有限，具有极强的稀缺性。该货币系统曾在4年内只有不超过1050万个，之后的总数量将被永久限制在2100万个。</p><p><br></p>', 'https://bitcoin.org/en/download', 'https://github.com/bitcoin/bitcoin', 'https://bitcoin.org/zh_CN/', 'Unkown', 'https://en.bitcoin.it/wiki/Comparison_of_mining_po', 'Satoshi Nakamoto', 'SHA-256', '2009-01-03', '约600秒/块', '21000000', '21000000', 'POW', 'Unkown', '当前12.5BTC/区块', '比特币因去中心化、全球流通、低交易费用 、匿名流通', '', '', '', '', '', '1', '0', '44323.4194250000', null, '18', null, null, 'https://www.blockchain.com/zh-cn/btc/tx/');
