INSERT INTO `coin` VALUES ('103', 'QTUM', '4', '量子链', '2018061518314300257894619894794.png', '0', '0', '2018-06-15 18:34:50', '2018-07-21 22:06:54', '0', '192.168.88.228', '24406', 'at_home', 'at_home98k', '', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00100000', '', '0.00000000', '10000.00000000', '', '1.00000000', '100.00000000', '1', '', '1', 'Qtum Blockchain', 'Qtum Blockchain（简称“量子链”或“Qtum”）致力于开发比特币和以太坊之外的第三种区块链生态系统，通过价值传输协议（“Value Transfer Protocol”）来实现点对点的价值转移，并根据此协议，构建一个支持多个行业（包括金融、物联网、供应链、社交、游戏等）的去中心化的应用开发平台（“DApp Platform”）。通过合并改进版本的比特币核心基础架构和可以相互兼容的以太坊虚拟机版本，量子链既拥有比特币坚不可摧的区块链网络又能发挥智能合约的无限可能。', '', '', 'https://www.qtum.org/zh/', '', '', '', '', '2017-03-16', '', '100,286,7', '73,786,79', '', '', '', '', '', '', '', '', '', '1', '0', '0.0000000000', null, '18', null, null, 'https://');
INSERT INTO `coin` VALUES ('104', 'QUN', '6', 'QUN', '20180616151857008173020232503159.png', '0', '0', '2018-06-16 15:46:30', '2018-06-18 11:52:42', '1', '192.168.88.231', '8588', '', '', '0x2d16d617b53eaa38a63df7a68ed215ba3d335acf', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.10000000', '', '0.00000000', '100000.00000000', '', '100.00000000', '10000.00000000', '1', '', '1', 'QunQun', 'QunQun是基于区块链的激励型社区平台。在QunQun上，人们可以无需任何编码和部署即可轻松创建属于自己的主题社区。人们通过运营自己的QunQun社区，或者参与其他社区贡献内容，均可获得来自QunQun奖励池的Token激励。', '', '', '', '', '', '', '', '', '', '1,500,000', '', '', '', '', '', '', '', '', '', '', '5913793', '1', '0.0000000000', '0x264dc2dedcdcbb897561a57cba5085ca416fb7b4', '18', null, null, null);
INSERT INTO `coin` VALUES ('105', 'EDU', '6', '教育积分', '2018061814175000529460824458291.png', '0', '0', '2018-06-18 14:17:53', null, '1', '192.168.88.231', '8588', '', '', '0x2d16d617b53eaa38a63df7a68ed215ba3d335acf', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00000000', '', '0.00000000', '0.00000000', '', '0.00100000', '10.00000000', '1', '', '1', 'EduCoin', 'EduCoin是建立在基于区块链和智能合约技术基础上，针对教学内容分享，教学服务消费与提供，教学产品技术分享，教学质量监控评估而设计的数字加密虚拟货币体系。\n\n请注意：简称是EDU的币有2个，一个是EduCoin教育币，一个是EduChain教育链，中文名相近，提醒各位用户在进行充值、交易和提现EDU时，需谨慎核对智能合约地址，避免混淆。', '', '', 'http://www.edu.one/', '', '', '', '', '2018-02-22', '', '15,000,0', '', '', '', '', '', '', '', '', '', '', '5913793', '1', '0.0000000000', '0xf263292e14d9d8ecd55b58dad1f1df825a874b7c', '18', null, null, null);
INSERT INTO `coin` VALUES ('106', 'DTA', '6', 'DTA', '2018061819383606218610965105446.png', '0', '0', '2018-06-18 19:39:30', null, '1', '192.168.88.231', '8588', '', '123456789', '0x2d16d617b53eaa38a63df7a68ed215ba3d335acf', '', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00000000', '', '0.00000000', '0.00000000', '', '100.00000000', '10000.00000000', '1', '', '1', 'DTA', '去中心化的信任联盟，旨在解决数字生态系统中用户不信任的问题。用区块链奖励的机制鼓励用户数据上链，以解决数据行业“数据孤岛”和“花园围墙”的“囚徒困境”问题，自建对标IPFS针对移动场景的M³去中心化移动存储系统用于数据存储，基于非合作博弈(non-cooperative game)和机器学习的用户信用模型，用以进行作假流量的检测和用户激励的计算。', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '5913793', '1', '0.0000000000', '0x69b148395ce0015c13e36bffbad63f49ef874e03', '18', null, null, null);
INSERT INTO `coin` VALUES ('107', 'OCN', '6', 'Odyssey', 'group1/M00/00/07/wKhY3Vs8ywyAZbUsAAOD8fGR4cE535.jpg', '0', '0', '2018-06-18 20:06:11', '2018-07-04 21:27:12', '1', '192.168.88.231', '8588', '', '', '0x2d16d617b53eaa38a63df7a68ed215ba3d335acf', '123456789', '0.00000000', '1', '1', '', '0.00000000', '0.00000000', '', '0.00100000', '', '0.00000000', '10000.00000000', '', '1000.00000000', '1000.00000000', '1', '', '1', 'Odyssey', 'ODYSSEY致力于打造区块链智能合约为依托的共享经济信用及交易体系，赋能真正去中心化的全球共享经济新形态，构建未来点对点交易生态系统。ODYSSEY将通过协议层将共享经济中各类型行业，及其中不同角色的参与者整合起来，把资产共享及交易变得效率更高，更快和更透明，为共享经济参与者打造运营成本更低，交易成本更低，更高效，收益回报更高的生态系统。OCOIN (OCN) 是ODYSSEY官方代币，可用在ODYSSEY生态系统内购买产品和服务。同时ODYSSEY将预留生态系统激励代币池，用来激励共享经济生态系统不同阶段的做出贡献的参与者。 ODYSSEY将通过协议层将共享经济中各类型行业，及其中不同角色的参与者整合起来，把资产共享及交易变得效率更高，更快和更透明，为共享经济参与者打造运营成本更低，交易成本更低，更高效，收益回报更高的生态系统。 OCOIN (OCN) 是ODYSSEY官方代币，可用在ODYSSEY生态系统内购买产品和服务。同时ODYSSEY将预留生态系统激励代币池，用来激励共享经济生态系统不同阶段的做出贡献的参与者。', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '5942554', '0', '0.0000000000', '0x4092678e4e78230f46a1534c0fbc8fa39780892b', '18', null, null, null);
